import React from "react";
import Table from 'react-bootstrap/Table'

function Layouts(props) {
    const conflict_hist = props;
    return (
        <div>
            <h1>Hello World!</h1> 
            <Table>
                <thead>
                    <tr>
                        <th>Test</th>
                    </tr>
                </thead>

                <tbody>
                    <tr>
                        <td>Test1</td>
                    </tr>
                </tbody>
            </Table>
        </div>
    );
}
export default Layouts;
